ahora yazgo inerte.\n\nBajen la caja, ya no les dar ms guerra, y sin piedad chenme un puo de tierra y la cierran.\n\n(Hablado) Por hoy a m se me acaba de acabar el mundo, este mundo de los ciegos, que como saben el rey siempre es el tuerto. Yo ya estaba condenado y voy a seguir esperando sus regalos el da de los muertos.\n\n#ALFREDOOLIVAS #ELDADELOSMUERTOS #MUSIC \n\nMusic video by Alfredo Olivas performing El Da De Los Muertos.  2018 Sahuaro Enterprise, Inc., Distributed by UMG Recordings Inc.\n\nhttp://vevo.ly/0GWmZc","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/CAWT8EPmCA8/hqdefault.jpg?sqp=-oaymwEbCKgBEF5IVfKriqkDDggBFQAAiEIYAXABwAEG\u0026rs=AOn4CLB28mNo7v8Slhap-aLgxNk8gxJZOA","width":168,"height":94},{"url":"https://i.ytimg.com/vi/CAWT8EPmCA8/hqdefault.jpg?sqp=-oaymwEbCMQBEG5IVfKriqkDDggBFQAAiEIYAXABwAEG\u0026rs=AOn4CLDofEZ-QFyHNFFiXbE_wKHAws-Giw","width":196,"height":110},{"url":"https://i.ytimg.com/vi/CAWT8EPmCA8/hqdefault.jpg?sqp=-oaymwEcCPYBEIoBSFXyq4qpAw4IARUAAIhCGAFwAcABBg==\u0026rs=AOn4CLAiMQAEtzSg3yGemx8vjw23dA5dHQ","width":246,"height":138},{"url":"https://i.ytimg.com/vi/CAWT8EPmCA8/hqdefault.jpg?sqp=-oaymwEcCNACELwBSFXyq4qpAw4IARUAAIhCGAFwAcABBg==\u0026rs=AOn4CLBDLL34EoBzV-uW0HcxWIaWVqmSVA","width":336,"height":188},{"url":"https://i.ytimg.com/vi_webp/CAWT8EPmCA8/maxresdefault.webp","width":1920,"height":1080}]},"allowRatings":true,"viewCount":"302841754","author":"AlfredoOlivasVEVO","isPrivate":false,"isUnpluggedCorpus":false,"isLiveContent":false},"annotations":[{"playerAnnotationsExpandedRenderer":{"featuredChannel":{"startTimeMs":"0","endTimeMs":"192000","watermark":{"thumbnails":[{"url":"https://i.ytimg.com/an/2a98faJ-hicyUR15M81pKg/featured_channel.jpg?v=5af3a169","width":54,"height":14}]},"trackingParams":"CBUQ8zciEwjwrMS60tCIAxWlbhIBHejQHlw=","navigationEndpoint":{"clickTrackingParams":"CBUQ8zciEwjwrMS60tCIAxWlbhIBHejQHlwyAml2","commandMetadata":{"webCommandMetadata":{"url":"/channel/UC2pmfLm7iq6Ov1UwYrWYkZA","w el montn, y el que ahora me muera no me quitar ese don.\n\nYo tuve la culpa, porque saba que era mortal, pido una disculpa por no atacar ese mal.\n\nSi ya estaba enterado, que era alrgico a la muerte, que hago en este sitio donde ahora yazgo inerte.\n\nBajen la caja, ya no les dar ms guerra, y sin piedad chenme un puo de tierra y la cierran.\n\n(Hablado) Por hoy a m se me acaba de acabar el mundo, este mundo de los ciegos, que como saben el rey siempre es el tuerto. Yo ya estaba condenado y voy a seguir esperando sus regalos el da de los muertos.\n\n#ALFREDOOLIVAS #ELDADELOSMUERTOS #MUSIC \n\nMusic video by Alfredo Olivas performing El Da De Los Muertos.  2018 Sahuaro Enterprise, Inc., Distributed by UMG Recordings Inc.\n\nhttp://vevo.ly/0GWmZc"},"lengthSeconds":"213","ownerProfileUrl":"http://www.youtube.com/@AlfredoOlivasVEVO","externalChannelId":"UC2a98faJ-hicyUR15M81pKg","isFamilySafe":true,"availableCountries":["AD","AE","AF","AG","AI","AL","AM","AO","AQ","AR","AS","AT","AU","AW","AX","AZ","BA","BB","BD","BE","BF","BG","BH","BI","BJ","BL","BM","BN","BO","BQ","BR","BS","BT","BV","BW","BY","BZ","CA","CC","CD","CF","CG","CH","CI","CK","CL","CM","CN","CO","CR","CU","CV","CW","CX","CY","CZ","DE","DJ","DK","DM","DO","DZ","EC","EE","EG","EH","ER","ES","ET","FI","FJ","FK","FM","FO","FR","GA","GB","GD","GE","GF","GG","GH","GI","GL","GM","GN","GP","GQ","GR","GS","GT","GU","GW","GY","HK","HM","HN","HR","HT","HU","ID","IE","IL","IM","IN","IQ","IR","IS","IT","JE","JM","JO","JP","KE","KG","KH","KI","KM","KN","KR","KW","KY","KZ","LA","LB","LC","LI","LK","LR","LS","LT","LU","LV","LY","MA","MC","MD","ME","MF","MG","MH","MK","ML","MM","MN","MO","MP","MQ","MR","MS","MT","MU","MV","MW","MX","MY","MZ","NA","NC","NE","NF","NG","NI","NL","NO","NP","NR","NU","NZ","OM","PA","PE","PF","PG","PH","PK","PL","PM","PN","PR","PS","PT","PW","PY","QA","RE","RO","RS","RU","RW","SA","SB","SC","SD","SE","SG","SH","SI","SJ","SK","SL","SM","SN","SO","SR","ST","SV","SX","SY","SZ","TC","TD","TF","TG", ebook | /alfredoolivasmusica\n\n\nLETRA:\n\nEL DA DE LOS MUERTOS\n\nSe lleg el momento, ya ni escog la madera, hace mucho tiempo estaba en lista de espera. Nunca me detuve, a organizar mi sepelio, cuentos invitados, cules Evangelios.Y tan de repente, se apag la luz, nuevo domicilio entre la tumba y la cruz. Al clan de los muertos, ahora soy nuevo egresado, hoy oficialmente comenzar mi legado a llevarse a cabo.\n\nQuiz fui un cualquiera, pero nunca del montn, y el que ahora me muera no me quitar ese don.\n\nYo tuve la culpa, porque saba que era mortal, pido una disculpa por no atacar ese mal.\n\nSi ya estaba enterado, que era alrgico a la muerte, que hago en este sitio donde ahora yazgo inerte.\n\nBajen la caja, ya no les dar ms guerra, y sin piedad chenme un puo de tierra y la cierran.\n\n(Hablado) Por hoy a m se me acaba de acabar el mundo, este mundo de los ciegos, que como saben el rey siempre es el tuerto. Yo ya estaba condenado y voy a seguir esperando sus regalos el da de los muertos.\n\n#ALFREDOOLIVAS #ELDADELOSMUERTOS #MUSIC \n\nMusic video by Alfredo Olivas performing El Da De Los Muertos.  2018 Sahuaro Enterprise, Inc., Distributed by UMG Recordings Inc.\n\nhttp://vevo.ly/0GWmZc","commandRuns":[{"startIndex":34,"length":24,"onTap":{"innertubeCommand":{"clickTrackingParams":"CJwEEM2rARgBIhMI4rvEutLQiAMVd4X_BB0ruyZdSI-QmJ-E_uSCCA==","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbkFObUMyS0p5UUtndDBxOVhjLTgtMXBacF96UXxBQ3Jtc0tuTnBWa3MwT29idU5ibkZ6aUwxa3otbGRrMTczQTRIdV8wVmpsOXFGdkVKZ3d3NTFNYnF5X2ExT1FTenQzY29hVXJWaHB1MkI4MW81eE1aX1pXMjF1ckhPV2t0TzI2OXQ1dGRCcEh2TVItQUZ3NmpkOA\u0026q=https%3A%2F%2Fspoti.fi%2F2P2Yj7w\u0026v=CAWT8EPmCA8","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbkFObUMyS0p5UUtndDBxOVhjLTgtMXBacF96UXxBQ3Jtc0tuTnBWa3MwT29idU5ibkZ6aUwxa3otbGRrMTczQTRId
